import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

function CompanyRegister() {
  const [companyName, setCompanyName] = useState('');
  const [industry, setIndustry] = useState('');
  const [companySize, setCompanySize] = useState('');
  const [companyLogo, setCompanyLogo] = useState(null);
  const [companyEmail, setCompanyEmail] = useState('');
  const [document, setDocument] = useState('');
  const [password, setPassword] = useState('');

  const [errors, setErrors] = useState({
    companyName: false,
    industry: false,
    companySize: false,
    companyLogo: false,
    companyEmail: false,
    document: false,
    password: false,
  });

  const [isModalOpen, setIsModalOpen] = useState(false);

  const navigate = useNavigate();
  const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;

  const handleRegister = (e) => {
    e.preventDefault();

    const newErrors = {
      companyName: !companyName,
      industry: !industry,
      companySize: !companySize,
      companyLogo: !companyLogo,
      companyEmail: !companyEmail || !emailRegex.test(companyEmail),
      document: !document,
      password: !password,
    };

    setErrors(newErrors);

    if (Object.values(newErrors).includes(true)) {
      if (!companyName) alert('Please enter a company name.');
      if (!industry) alert('Please enter the industry.');
      if (!companySize) alert('Please select the company size.');
      if (!companyLogo) alert('Please upload the company logo.');
      if (!companyEmail) {
        alert('Please enter an official company email.');
      } else if (!emailRegex.test(companyEmail)) {
        alert('Please enter a valid email format (e.g., example@domain.com).');
      }
      if (!document) alert('Please upload the required documents.');
      if (!password) alert('Please enter a password.');
      return;
    }

    // Set registration completed flag in localStorage
    localStorage.setItem('isRegistered', 'true');

    // Show the modal on successful submission
    setIsModalOpen(true);
  };

  const handleLogoChange = (e) => {
    setCompanyLogo(e.target.files[0]);
  };

  const handleDocumentChange = (e) => {
    setDocument(e.target.files[0]);
  };

  const closeModal = () => {
    setIsModalOpen(false);
    // Redirect to the "companylogin" page after closing the modal
    navigate('/companylogin');
  };

  return (
    <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh' }}>
      <div style={{ padding: '20px', border: '1px solid #ddd', borderRadius: '8px' }}>
        <h2>Company Register</h2>
        <form onSubmit={handleRegister}>
          {/* Company Registration Fields */}
          <div>
            <label>Company Name:</label>
            <input
              type="text"
              value={companyName}
              onChange={(e) => setCompanyName(e.target.value)}
              placeholder="Enter company name"
              style={{
                width: '100%',
                padding: '8px',
                marginBottom: '10px',
                borderColor: errors.companyName ? 'red' : '#ddd',
              }}
            />
          </div>
          {/* Other input fields for Industry, Company Size, Logo, Email, Password, etc. */}
          {/* Submit Button */}
          <button
            type="submit"
            style={{
              padding: '10px',
              backgroundColor: '#4CAF50',
              color: 'white',
              border: 'none',
              borderRadius: '4px',
            }}
          >
            Register
          </button>
        </form>
      </div>

      {/* Modal for Success Message */}
      {isModalOpen && (
        <div
          style={{
            position: 'fixed',
            top: '0',
            left: '0',
            width: '100%',
            height: '100%',
            backgroundColor: 'rgba(0, 0, 0, 0.5)',
            display: 'flex',
            justifyContent: 'center',
            alignItems: 'center',
          }}
        >
          <div
            style={{
              backgroundColor: 'white',
              padding: '20px',
              borderRadius: '8px',
              textAlign: 'center',
              width: '400px',
            }}
          >
            <h3>Information Submitted</h3>
            <p>Your company information has been submitted. Please wait for SCAD to review and accept your submission.</p>
            <button
              onClick={closeModal}
              style={{
                padding: '10px',
                backgroundColor: '#4CAF50',
                color: 'white',
                border: 'none',
                borderRadius: '4px',
              }}
            >
              OK
            </button>
          </div>
        </div>
      )}
    </div>
  );
}

export default CompanyRegister;
